import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import "./StockDetails.css";
import { Tab, Tabs, Box, Button } from "@mui/material";
import Modal from "react-bootstrap/Modal";
import { TabContext, TabPanel, TabList } from "@mui/lab";
import NewsDetailsComponent from "./NewsDetails";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";
import Form from "react-bootstrap/Form";
import InputGroup from "react-bootstrap/InputGroup";
import {AiOutlineStar} from "react-icons/ai";


function StockDetailsComponent() {
  const { id } = useParams();
  const [tickerData, setTickerData] = useState(null);
  const [iexData, setIexData] = useState(null);
  const [newsData, setNewsData] = useState(null);
  const [dailyChart, setDailyChartInfo] = useState(null);
  const [value, setValue] = useState("1");

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const options = {
    title: {
      text: "Company name",
    },
    series: [
      {
        data: [1, 2, 3],
      },
    ],
  };

  useEffect(() => {
    // Perform API call here and set the data
    // http://localhost:8080/ticker/NVDA
    // fetch(`http://localhost:8080/ticker/${id}`)
    //   .then((response) => response.json())
    //   .then((data) => {
    //     setTickerData(data);
    //     console.log("Data: ");
    //     console.log(data);
    //   });
    // fetch(`http://localhost:8080/iex/${id}`)
    // .then((response) => response.json())
    // .then((data) => {
    //   setIexData(data);
    //   console.log("IEX Data: ");
    //   console.log(data);
    // });

    fetch(`http://localhost:8080/news/${id}`)
      .then((response) => response.json())
      .then((data) => {
        setNewsData(data);
        console.log("News: ");
        console.log(data);
      });

    // fetch(`http://localhost:8080/dailyChart/${id}`)
    // .then((response) => response.json())
    // .then((data) => {
    //   setDailyChartInfo(data);
    //   console.log("Daily Chart: ");
    //   console.log(data);
    // });
  }, [id]);

  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  const onBuyClick = () => {
    console.log("Buy button clicked");
    handleShow();
  };

  const addToPortfolio = () => {

    console.log("Add to portfolio button clicked");

    const existingStocks = localStorage.getItem("stocks");

    // Parse the existing stocks as an array (or initialize an empty array if there are no existing stocks)
    const stocks = existingStocks ? JSON.parse(existingStocks) : [];

    // Add the new stock to the array
    const newStock = {
      symbol: "XYZ", // Replace with the symbol of the stock you want to add
      quantity: 10, // Replace with the quantity of the stock you want to add
    };
    stocks.push(newStock);

    // Save the updated stocks array back to the local storage
    localStorage.setItem("stocks", JSON.stringify(stocks));

    // Optionally, you can perform any additional actions after adding the stock to the local storage
  };

  return (
    <div>
      {/* {tickerData && ( */}
      <div className="container resultPage">
        <div className="row">
          <div className="col leftCol">
            <div className="container companyData">
              <div className="row">
                <div className="col">
                  <h1>
                    ticker
                    {/* {tickerData['ticker']} */}
                  </h1>
                </div>
                <div className="col">
                  <h5>
                    {/* {id} */}
                    fav_btn
                    <AiOutlineStar 
                    color="yellow"/>
                  </h5>
                </div>
              </div>

              <div className="row">
                <h3>
                  name
                  {/* {tickerData['name']} */}
                </h3>
              </div>

              <div className="row">
                <h5>
                  exchangecode
                  {/* {tickerData['exchangeCode']} */}
                </h5>
              </div>

              <div className="row">
                <Button
                  variant="contained"
                  color="success"
                  style={{ maxWidth: "10px", marginLeft: "10px" }}
                  onClick={() => onBuyClick()}
                >
                  Buy
                </Button>
              </div>
            </div>
          </div>

          {/* Modal for buying stocks */}
          <Modal show={show} onHide={handleClose}>
            <Modal.Header closeButton>
              <Modal.Title>{id}</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <div className="row">Current Price: $100</div>
              <div className="row">
                Quantity: 1
                <input type="number" />
              </div>
            </Modal.Body>
            <Modal.Footer>
              <div className="container">
                <div className="row footer">
                  <div
                    className="col total_cost"
                    style={{ paddingLeft: "0px" }}
                  >
                    <div className="row">Total Cost: $100</div>
                  </div>
                  <div className="col buy_button d-flex justify-content-end">
                    <Button
                      variant="contained"
                      color="success"
                      onClick={addToPortfolio}
                    >
                      BUY
                    </Button>
                  </div>
                </div>
              </div>
            </Modal.Footer>
          </Modal>

          <div className="col rightCol">
            <div className="container stockValues">
              <div className="row justify-content-end">
                <h1>
                  {/* {id} */}
                  Stock Value
                </h1>
              </div>
              <div className="row justify-content-end">
                <h3>
                  {/* {id} */}
